import axios from "axios";
import { useEffect, useState } from 'react';
import '../components/Context';
import { Link } from "react-router-dom";
import Card from "../components/CardsCharacters";


function Character() {
const[people, setPeople] = useState([]);
  
      const getDataApi = async (people) => {
          const response = await axios.get(
              `https://swapi.dev/api/people/1/`);
              setPeople(response.data);
      console.log(response.data);
  
      const renderPeople = () => {

          return people.map((people) => 
          <article key={people.name}>
            <img src={people.image} alt="" />
            <h4>{people.planet}</h4>
            <Link to={"/people/"}>
              <Card item={people} />
            </Link>
          </article>)
        }
      
    return (
        <section>
            {renderPeople({})}
        </section>
    )
}
      useEffect(() => {
          getDataApi();
      },[])
    
      return(
        <>
        <div>
        <h1>Personajes de Star Wars</h1>
        <select name="" id="" onChange={() => setPeople({})}>
            <option value="people">personajes</option>
          </select>

          <div>
            <h3>Personajes</h3>
            <div>
                <h4>{people.name}</h4>
                <img src={people.url} alt={people.name} />
            </div>
        </div>
        
        </div>
        </>
)
}

export default Character
